import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { UserRouteAccessService } from 'app/core/auth/user-route-access.service';
import { OverpaymentComponent } from '../overpayment.component';
import {
  MipsUploadApprovalComponent
} from 'app/payment/overpayment/mips-upload-approval/mips-upload-approval.component';
import { ApproveRefundComponent } from '../approve-refund/approve-refund.component';

const overpaymentRoute: Routes = [
  {
    path: '',
    component: OverpaymentComponent,
    data: {
      defaultSort: 'id,asc'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'mips/approval',
    component: MipsUploadApprovalComponent,
    data: {
      defaultSort: 'id,asc'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'refund/approval',
    component: ApproveRefundComponent,
    data: {
      defaultSort: 'id,asc'
    }
  }
];

@NgModule({
  imports: [RouterModule.forChild(overpaymentRoute)],
  exports: [RouterModule]
})
export class OverpaymentRoutingModule {
}
